window.bookSummaryJSON = "<p>Brace yourself for the most electrifying, adrenaline-fueled mission yet with <i>USS Lincoln — Mercy Kill</i> by Mark Wayne McGinnis. </p> <p>Caught in a deadly game of interstellar cat and mouse with a new and vile alien enemy, Captain Galvin Quintos will be forced to make choices no US Space Navy Captain should ever have to make—including who among those he cares most about should live or die. A cosmic storm is coming, one that has already decimated the long-lost crew of USS <i>Lincoln</i>. Has USS <i>Adams</i> already fallen into the same perilous trap, poised to succumb to the same fate? Has Doctor Vivian Leigh finally had enough uncertainty aboard a military warship? Is it time to bid farewell to a three-hundred-year-old ChronoBot friend? </p> <p>Put up the \"Do Not Disturb\" sign, grab a bag of popcorn, switch your phone to silent, and sink into that favorite chair of yours...you're in for a long night.</p>"; 
